import React, {Components} from "react"
import styles from "./layoutContainer.module.css"
import Toolbar from "./../ToolbarConntainer/ToolbarContainer"
import Aux from "./../../hocs/Aux/Aux"

class LayoutContainer extends Components{
  constructor(props){
    super(props);
    this.state = {
      isAuthenticated:{
        status: false,
        data: null
      }
    }
  }
  render(){
    return(
      <Aux>
        <Toolbar/>
        <main></main>
      </Aux>
    )
  }
}

export default LayoutContainer;
